  \"2014-11-13T17:06:15.547193\",\n\t\"name\": \"plant-variety-protection-office-certificate-database\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Plant Variety Protection Office (PVPO)
  Scanned Certificates Database is a collection of Certificates of Protection for
  new plant varieties that are seed reproduced or tuber propagated.  A variety may
  be represented by seeds, transplants, plants, tubers, tissue culture plantlets and
  other matter.  A Certificate of Protection is awarded to an owner of a variety after
  an examination shows that it is new, distinct from other varieties, and genetically
  uniformed and stable through successive generations.  This tool allows stakeholders
  access to the breeding history and morphological characteristics used in developing
  new plant varieties.  This tool contains over 5,000 varieties that have been issued
  a Certificate of Protection since 1975.\",\n\t\"license_title\": \"Creative Commons
